const Prefetch = () => {
    useEffect(() => {
        console.log('subscribing')
        const users = store.dispatch(usersApiSlice.endpoints.getUsers.initiate())

        return () => {
            console.log('unsubscribing')
            users.unsubscribe()
        }
    }, [])

    return <Outlet />
}
export default Prefetch
